import React from 'react';
import './App.css';
class Aboutmain extends React.Component {
    render() {
        return (
            <div className="form form-inline">
                <div className="card">
                    <div className="card-body">
                        <h5 className="card-title">52%</h5>
                        <h6 className="card-subtitle mb-2 text-muted"></h6>
                        <p className="card-text">Machine work</p>
                    </div>
                    </div>&nbsp;
                    <div className="card">
                    <div className="card-body">
                        <h5 className="card-title">16</h5>
                        <h6 className="card-subtitle mb-2 text-muted"></h6>
                        <p className="card-text">Active operator</p>

                    </div>

                </div>&nbsp;
                <div className="card">
                    <div className="card-body">
                        <h5 className="card-title">4%</h5>
                        <h6 className="card-subtitle mb-2 text-muted"></h6>
                        <p className="card-text">Product discharge</p>

                    </div>

                </div>&nbsp;
                <div className="card">
                    <div className="card-body">
                        <h5 className="card-title">07:38:00</h5>
                        <h6 className="card-subtitle mb-2 text-muted"></h6>
                        <p className="card-text">Start time</p>

                    </div>

                </div>&nbsp;
                <div className="card">
                    <div className="card-body">
                        <h5 className="card-title">06:57:00</h5>
                        <h6 className="card-subtitle mb-2 text-muted">Duration</h6>
                        <p className="card-text">content.</p>

                    </div>

                </div>

            </div>

        );


    }
}
export { Aboutmain };
